def my_func(input1):
    if input1 is None:
        return None

    words = input1.split(' ')
    camel_case_words = []

    for word in words:
        if '-' in word:
            parts = word.split('-')
            camel_case_word = parts[0] + ''.join(part.capitalize() for part in parts[1:])
            camel_case_words.append(camel_case_word)
        else:
            camel_case_words.append(word)

    return ' '.join(camel_case_words)
